INSERT INTO `questions` (`id`,`question_text`,`question_type_id`,`priority`,`quiz_id`,`point`,`added_date`,`parent_id`,`question_total`,`check_total`,`header_text`,`footer_text`,`question_text_eng`,`help_image`) VALUES 
 (1,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A train speeds past a pole in 15 seconds and speeds past a platform 100 meters long in 25 seconds. Its length in meters is ________?</div>\n',1,1,1,'1','2023-09-27 20:28:38',0,NULL,NULL,'','',NULL,NULL),
 (2,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A man standing on a railway platform notices that a train going in one direction takes 9 seconds to pass him and other train of the same length takes 6 seconds to pass him. Find the time taken by the two trains to cross each other when they are running in the same direction?</div>\n',1,2,1,'1','2023-09-27 20:28:38',0,NULL,NULL,'','',NULL,NULL),
 (3,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The distance between two stations &ldquo;A&rdquo; and &ldquo;B&rdquo; is 300 kms. One train leaves station &ldquo;A&rdquo; towards station &ldquo;B&rdquo; at the average speed of 40 km/hr. At the same time, another train left station &ldquo;B&rdquo; towards &ldquo;A&rdquo; at the average speed of 80 km/hr. The distance from station &ldquo;A&rdquo; where the two trains meet is ________?</div>\n',1,3,1,'1','2023-09-27 20:28:38',0,NULL,NULL,'','',NULL,NULL),
 (4,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A train leaves station &rdquo;A&rdquo; towards &ldquo;B&rdquo; at an average speed of 60 km/hr at 9 a.m. After 2 hours another train leaves station &ldquo;A&rdquo; at an average speed of 100 km/hr. When the two trains will meet?</div>\n',1,4,1,'1','2023-09-27 20:28:38',0,NULL,NULL,'','',NULL,NULL),
