 (261,'<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">Find the time after which both the trains meet each other for the second time? </div>\n<div style=\"font-weight:bold;\">I. Train &lsquo;A&rsquo; started from station &lsquo;P&rsquo; towards station &lsquo;Q&rsquo; with the speed 36 km/hr.</div>\n<div style=\"font-weight:bold;\">II.At the same time, train &lsquo;B&rsquo; started from station &lsquo;Q&rsquo; towards station &lsquo;P&rsquo; with the speed of 48 Km/hr.</div>\n<div style=\"font-weight:bold;\">III.Speed of train &lsquo;B&rsquo; is (100/3)% more than the speed of train &lsquo;A&rsquo;. After reaching their destinations, both the trains returns to their initial position. </div>\n',1,1,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (262,'<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">Pipes &ldquo;A&rdquo; started to fill a tank. How many hours required filling the remaining tank by pipe &ldquo;B&rdquo; alone, if pipe &ldquo;A&rdquo; should be closed after 7 hours?</div>\n<div style=\"font-weight:bold;\">I. Pipe &ldquo;A&rdquo; alone can fill the tank in 10 hours.</div>\n<div style=\"font-weight:bold;\">II. The efficiency of pipe &ldquo;A&rdquo; is 100% more than the efficiency of pipe &ldquo;B&rdquo;.</div>\n<div style=\"font-weight:bold;\">III. Pipe &ldquo;B&rdquo; can fill (2/5) of the tank in 8 hours.</div>\n',1,2,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (263,'<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">A person invested certain sum of money in scheme which offers simple interest at the rate of 5%. What is the amount of interest earned in 5 years with same rate of interest?</div>\n<div style=\"font-weight:bold;\">I. The same amount of money gives Rs 300 as simple interest in 2 years.</div>\n<div style=\"font-weight:bold;\">II. If the difference between the S.I and CI earned at the end of 2 years on the same sum and the same rate of interest is Rs 200.</div>\n<div style=\"font-weight:bold;\">III. He invested Rs 2000 more in other scheme which offers interest at the rate 10%.</div>\n',1,3,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (264,'<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">What was the price of the house &ldquo;A&rdquo; in 2008?</div>\n<div style=\"font-weight:bold;\">I. The ratio of price of &ldquo;A&rdquo; to &ldquo;B&rdquo; in 2008 was 7:8</div>\n<div style=\"font-weight:bold;\">II. The price of house &ldquo;B&rdquo; in 2009 was 650000 and it has increased by 30% from 2008</div>\n<div style=\"font-weight:bold;\">III. The ratio of price of houses &ldquo;A&rdquo; and &ldquo;B&rdquo; in 2009 was 6:7</div>\n',1,4,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (265,'<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">How many students in a college did not secure first class grade in final examination?</div>\n<div style=\"font-weight:bold;\">I. 80% of the total students passed the examination and this students were classified as first, second and third class.</div>\n<div style=\"font-weight:bold;\">II. The ratio of failed students to first class grade students is 4:5</div>\n<div style=\"font-weight:bold;\">III. The total number students in the college were 600.</div>\n',1,5,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (266,'<div style=\"font-weight:bold;\">\r\n	Use the data of the statements and then determine which of the following statementis necessary to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	A) If the data in statement I alone is sufficient to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	B) If the data in statement II alone is sufficient to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	C) If the data either in statement I alone or statement II alone are sufficient to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	D) If the data given in both I and II together are not sufficient to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	E) If the data in both the statements I and II together are necessary to answer the question.</div>\r\n<div style=\"font-weight:bold;\">\r\n	What is the average speed of truck?</div>\r\n<div style=\"font-weight:bold;\">\r\n	Statement I:Average speed of car is twice that of average speed of truck. Average speed of bus is 60 km/hr.</div>\r\n<div style=\"font-weight:bold;\">\r\n	Statement II:Average speed of bus is two-third of average speed of train. The car can travel same distance in 3 hrs as bus can travel in 2 hrs</div>',1,6,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (267,'<div style=\"font-weight:bold;\">Use the data of the statements and then determine which of the following statementis necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">A) If the data in statement I alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">B) If the data in statement II alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">C) If the data either in statement I alone or statement II alone are sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">D) If the data given in both I and II together are not sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">E) If the data in both the statements I and II together are necessary to answer the question</div>\n<div style=\"font-weight:bold;\">In how much time can pipe C empty the tank?</div>\n<div style=\"font-weight:bold;\">Statement I:Pipes A and B can fill half the tank in 4 hrs 30 minutes.</div>\n<div style=\"font-weight:bold;\">Statement II:Together with emptying pipe C, pipes A and B can fill the tank in 22 (1/2) hrs</div>\n',1,7,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (268,'<div style=\"font-weight:bold;\">Use the data of the statements and then determine which of the following statementis necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">A) If the data in statement I alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">B) If the data in statement II alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">C) If the data either in statement I alone or statement II alone are sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">D) If the data given in both I and II together are not sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">E) If the data in both the statements I and II together are necessary to answer the question. </div>\n<div style=\"font-weight:bold;\">A, B and C invested Rs 52,000 in a business in ratio 6 : 3 : 4 respectively. What is the profit % earned by them after a year?</div>\n<div style=\"font-weight:bold;\">Statement I:C got Rs 8000 as his share of profit.</div>\n<div style=\"font-weight:bold;\">Statement II:The difference in profits earned by A and B is Rs 6000.</div>\n',1,8,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (269,'<div style=\"font-weight:bold;\">Use the data of the statements and then determine which of the following statementis necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">A) If the data in statement I alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">B) If the data in statement II alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">C) If the data either in statement I alone or statement II alone are sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">D) If the data given in both I and II together are not sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">E) If the data in both the statements I and II together are necessary to answer the question</div>\n<div style=\"font-weight:bold;\">How much money did Yami borrow?</div>\n<div style=\"font-weight:bold;\">Statement I:If borrowed for 6 years at 6% rate of interest per annum, she has to give double interest as earlier.</div>\n<div style=\"font-weight:bold;\">Statement II:If the rate of interest per annum increases from 6% to 8% then she could borrow 25% less to give same amount of interest.</div>\n',1,9,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
 (270,'<div style=\"font-weight:bold;\">Use the data of the statements and then determine which of the following statementis necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">A) If the data in statement I alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">B) If the data in statement II alone is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">C) If the data either in statement I alone or statement II alone are sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">D) If the data given in both I and II together are not sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">E) If the data in both the statements I and II together are necessary to answer the question</div>\n<div style=\"font-weight:bold;\">If the selling price of an article is Rs 12,000, then what is the profit/loss% on it?</div>\n<div style=\"font-weight:bold;\">Statement I:The ratio of the selling and price and cost price of the article is 4 : 3.</div>\n<div style=\"font-weight:bold;\">Statement II:The difference between the cost price and selling price of the article is Rs 2000</div>\n',1,10,14,'1','2023-09-27 20:28:42',0,NULL,NULL,'','',NULL,NULL),
