 (382,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">You know that your suit is excellent, when people ask about your tailor who tailored the suit.</div>\n<div style=\"font-weight:bold;\">Assumptions:</div>\n<div style=\"font-weight:bold;\">1. People do not ask about your tailor, if your suit is not good.</div>\n<div style=\"font-weight:bold;\">2. The people want to know the criterion of an excellent suit.</div>\n',1,2,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (383,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should there be small states formed out of the larger states in India?</div>\n<div style=\"font-weight:bold;\">Arguments: </div>\n<div style=\"font-weight:bold;\">I: No, this will allow the danger to national integration.</div>\n<div style=\"font-weight:bold;\">II: Yes, this will result in administrative convenience.</div>\n',1,3,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (384,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should all the unauthorized structures in the city be demolished?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. No. Where will the people residing in such houses live?</div>\n<div style=\"font-weight:bold;\">2. Yes. This will give a clear message to general public and they will refrain from constructing unauthorized buildings.</div>\n',1,4,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (385,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should there be a maximum limit for the number of ministers in the Central Government?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. No. The political party in power should have the freedom to decide the number of ministers to be appointed.</div>\n<div style=\"font-weight:bold;\">2. Yes. The number of ministers should be restricted to a certain percentage of the total number of seats in the parliament to avoid unnecessary expenditure.</div>\n',1,5,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (386,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Is buying things on instalments profitable to the customer?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. Yes. He has to pay less.</div>\n<div style=\"font-weight:bold;\">2. No, paying instalments upsets the family budget.</div>\n',1,6,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (387,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should foreign films be banned in India?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. Yes. They depict an alien culture which adversely affects our values.</div>\n<div style=\"font-weight:bold;\">2. No. Foreign films are of a high artistic standard.</div>\n',1,7,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (388,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should the railways in India be privatized in a phased manner like other public sector enterprises?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. Yes. This is the only way to bring in competitiveness and provide better services to the public.</div>\n<div style=\"font-weight:bold;\">2. No. This will pose a threat to the national security of our country as multinationals will enter into the fray.</div>\n',1,8,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (389,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should cottage industries be encouraged in rural areas?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. Yes. Rural people are creative.</div>\n<div style=\"font-weight:bold;\">2. Yes. This would help to solve the problem of unemployment to some extent.</div>\n',1,9,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (390,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should India engage into a dialogue with neighbouring countries to stop cross border tension?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. Yes. This is the only way to reduce the cross border terrorism and stop loss of innocent lives.</div>\n<div style=\"font-weight:bold;\">2. No. Neighbouring countries cannot be relied upon in such matters, they may still engage in subversive activities.</div>\n',1,10,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (391,'<div style=\"font-weight:bold;\">Priest: Do you speak to the devil and follow his biddings?</div>\n<div style=\"font-weight:bold;\">Parishioner: Yes.</div>\n<div style=\"font-weight:bold;\">Priest: You must be lying. Nobody who is in league with the devil tells the truth.</div>\n<div style=\"font-weight:bold;\">Why can the priest&rsquo;s behaviour be considered paradoxical?</div>\n',1,11,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (392,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should import duty on all the electronic goods be dispensed with?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">1. No. This will considerably reduce the income of the government and will adversely affect the developmental activities.</div>\n<div style=\"font-weight:bold;\">2. No. The local manufacturers will not be able to compete with the foreign manufacturers who are technologically far superior.</div>\n',1,12,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (393,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should all government work for job must be online?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes, this will reduce paperwork and beneficial for environment.</div>\n<div style=\"font-weight:bold;\">II. Yes, this process will be transparent and corruption free.</div>\n',1,13,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (394,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should all the courses be technical oriented?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes because this will increase the chance of employment.</div>\n<div style=\"font-weight:bold;\">II. No, some other courses apart from technical courses also do have importance.</div>\n',1,14,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (395,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should universities in foreign style education be established in India?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes, if we have foreign style education then we can excel in studies.</div>\n<div style=\"font-weight:bold;\">II. No, students will forget our Indian culture.</div>\n',1,15,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (396,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should children be legally made responsible to take care of their parents during their old age?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes. Such matter can only be solved by legal means.</div>\n<div style=\"font-weight:bold;\">II. Yes. Only this will bring some relief to poor parents.</div>\n',1,16,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (397,'<div style=\"font-weight:bold;\">\r\n	Statement:</div>\r\n<div style=\"font-weight:bold;\">\r\n	The serious accident in which a person was run down by a car yesterday has again focused attention on the most unsatisfactory state of roads.</div>\r\n<div style=\"font-weight:bold;\">\r\n	Conclusions/Inference:</div>\r\n<div style=\"font-weight:bold;\">\r\n	I. The accident that occurred was fatal</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. Several accidents have so far taken place because of unsatisfactory state of roads.</div>',1,17,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (398,'<div style=\"font-weight:bold;\">\r\n	Statement:</div>\r\n<div style=\"font-weight:bold;\">\r\n	The best evidence of India&rsquo;s glorious past is the growing popularity of Ayurvedic medicines in the west.</div>\r\n<div style=\"font-weight:bold;\">\r\n	Conclusions/Inference:</div>\r\n<div style=\"font-weight:bold;\">\r\n	I. Ayurvedic medicines are not popular in India.</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. Allopathic medicines are more popular in India.</div>',1,18,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (399,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Interview panel may select a student who does not possess the desired abilities nor any value.</div>\n<div style=\"font-weight:bold;\">Conclusion: </div>\n<div style=\"font-weight:bold;\">1 The inclusion of experts in interview panel does not ensure that the candidates will be selected properly.</div>\n<div style=\"font-weight:bold;\">2. Interview procedure of admission does have some limitations.</div>\n',1,19,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (400,'<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">In India, there should be more and more emphasis given to the agricultural engineering and technological fields instead of pure and basic science.</div>\n<div style=\"font-weight:bold;\">Conclusion: </div>\n<div style=\"font-weight:bold;\">1. Sufficient development has been achieved in India in the field of basic and pure science.</div>\n<div style=\"font-weight:bold;\">2. The production industry in India was neglected in the past.</div>\n',1,20,20,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
 (401,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	READING COMPREHENSION:</div>\r\n<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	Passage:</div>\r\n<div style=\"margin-bottom:7px;font-weight:normal;text-align:justify;text-indent:0.5in;\">\r\n	One likes to think that one&rsquo;s attitudes, beliefs, and related behaviour form a consistent pattern. Incongruity that is detected results in a sense of imbalance or dissonance, which the person then seeks to correct. The motivating effects of the need to correct incongruity, imbalance, or dissonance has been the occasion for several theories. We may select for consideration the theory proposed by Festinger which treats cognitive dissonance and its reduction. The kind of disagreement or disharmony with, which Festinger has been chiefly concerned is that which occurs after a decision has been made, after one is committed to a course of action; under such circumstances, there is often some lack of harmony between what one does and what one believes, and there is pressure to change either one&rsquo;s behaviour or one&rsquo;s beliefs. For example, if a regular smoker reads about the relationship between smoking and lung cancer, the habitual action and the new information are dissonant. If the decision is made to continue smoking, the dissonance will be reduced by disbelieving the information about the relationship between smoking and lung cancer; if the decision is made to give up smoking, the information on the linkage between smoking and lung cancer will be accepted. The fact that this information also affected the decision is not important here. As Festinger and others have shown, the weighing of alternatives is more realistic prior to the decision; after the decision, the pressure is great to bring belief and action into balance. The theory goes on to make some non-obvious predictions; for example, in some cases, failure of expectations instead of destroying belief may strengthen it. This was illustrated by the study of a group of people who expected to be saved from a prophesied disastrous flood by the intervention of a heavenly being. The theory predicted that when the long-awaited day arrived and the prophecy failed (no flood), those who had the social support of the other believers would indeed proselyte for their beliefs with new enthusiasm; while those who had to face the crisis alone would have their faith weakened. These predicted results did indeed occur, the rationalization for the group of disappointed believers who faced failure together being that God had postponed his vengeance because of their faith. The tendency to be consistent is but one aspect of how self-perception influences motivation. Earlier illustrations of human motivation might also be reinterpreted in these terms. For example, the success motivation and the avoidance of failure are also concerned with how a person sees himself. R.W. White, for example, reinterprets many motives concerned with curiosity, and desire for knowledge and for achievement as though they are all concerned with one&rsquo;s sense of competence as a person who is effective in relation to the environment. In another sense, the person likes to develop his potentials to the full, to be as complete a person as he can. For such a pervasive type of motive, the expression self-actualization was coined, originally by Carl Jung, one of Freud&rsquo;s followers who later developed a system of his own. By self-actualization, he meant the development of full individuality, with all parts somehow in harmony. The term and closely related ones (productive orientation, creative becoming, etc.) have been used by man psychologists who criticize contemporary motivational theory as being too narrow concerned with short episodes of choice and behaviour rather than with the more profound and pervasive aspects of individual hopes and aspirations.</div>\r\n<div style=\"margin-bottom:7px;font-weight:normal;\">\r\n	Which of the following situations is most likely to give rise to cognitive dissonance?</div>',1,1,21,'1','2023-09-27 20:28:43',0,NULL,NULL,'','',NULL,NULL),
