 (410,'<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	READING COMPREHENSION:</div>\r\n<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	Passage:</div>\r\n<div style=\"margin-bottom:7px;font-weight:normal;text-align:justify;text-indent:0.5in;\">\r\n	<p>\r\n		It all started at the beginning of fifth grade. At first, Sarah wasn&rsquo;t really sure what was happening. In class, she had to squint to see the blackboard clearly. She had to do the same thing when she read street signs, or when she watched a movie. As the fuzziness got worse, she became more and more worried. It was important for her to see the notes and homework assignments the teacher put on the board.</p>\r\n	<p>\r\n		It wasn&rsquo;t long before Sarah found herself squinting all the time, but she didn&rsquo;t want anyone to know that she was having a problem seeing. In class, she asked for a desk that was closer to the blackboard. One day, her teacher said, &ldquo;Sarah, are you all right? I&rsquo;ve noticed you squinting a lot. Are you having trouble seeing the board?&rdquo;</p>\r\n	<p>\r\n		Sarah shook her head. &ldquo;I&rsquo;m fine, Mrs. Cruz,&rdquo; she said, but she knew she couldn&rsquo;t pretend much longer.</p>\r\n	<p>\r\n		At home, she had to sit closer and closer to the television in order to see the picture. Her mother noticed her squinting as she watched her favourite shows, and she began to get suspicious.</p>\r\n	<p>\r\n		&ldquo;Tomorrow I&rsquo;m calling the eye doctor to set up an appointment for you,&rdquo; she said firmly. Sarah protested, but her mother&rsquo;s mind was made up.</p>\r\n	<p>\r\n		Three days later, Sarah had new glasses and instructions from her doctor to wear them all the time. Sarah frowned in the car the whole way home. &ldquo;All of the kids at school will think I&rsquo;m a nerd,&rdquo; she said. Her mother smiled and shook her head. &ldquo;You look just as beautiful with those glasses on as you do without them,&rd